import React, { useState, useEffect } from "react";
import Content from "../../components/Content";
import PacienteService from "../../services/PacienteServices";
import axios from "axios";
import { useNavigate } from "react-router-dom";
import Layout from "../../containers/Layout";

// LIBRERIAS FORMULARIOS
import {
  FormControl,
  InputLabel,
  TextField,
  MenuItem,
  Select,
  Button,
} from "@mui/material";



const PacientesAdd = () => {
  const [nomPaciente, setnomPaciente] = useState("");
  const [ap1Paciente, setap1Paciente] = useState("");
  const [ap2Paciente, setap2Paciente] = useState("");
  const [edadPaciente, setedadPaciente] = useState("");
  const [sexoPaciente, setsexoPaciente] = useState("");
  const [psicologo, setPsicologo] = useState("");
  const [psicologos, setPsicologos] = useState([]);

  const navigate = useNavigate();

  const server = "http://localhost:4002";

  const getData = async () => {
    const { data } = await axios.get(`${server}/psicologos`);
    console.log(data);
    setPsicologos(data);
  };

  useEffect(() => {
    getData();
  }, []);

  const handlePaciente = (event) => {
    setnomPaciente(event.target.value);
  };
  const handleap1Paciente = (event) => {
    setap1Paciente(event.target.value);
  };
  const handleap2Paciente = (event) => {
    setap2Paciente(event.target.value);
  };
  const handleedadPaciente = (event) => {
    setedadPaciente(event.target.value);
  };
  const handlesexoPaciente = (event) => {
    setsexoPaciente(event.target.value);
  };
  const handlePsicologo = (event) => {
    setPsicologo(event.target.value);
  };
  const handlePsicologos = (event) => {
    setPsicologos(event.target.value);
  };

  const Cancelar = () => {
    navigate("/");
  };

  const handleSubmit = () => {
    let paciente = {
      nomPaciente: nomPaciente,
      ap1Paciente: ap1Paciente,
      ap2Paciente: ap2Paciente,
      edadPaciente: edadPaciente,
      sexoPaciente: sexoPaciente,
      idPsicolgo: parseInt(psicologo),
    };
    
    console.log(paciente);

    try{
      PacienteService.createPaciente(paciente);
    }
    catch (error){
      console.error("Error al actualizar el Paciente:", error);
    }
    
    navigate("/");
  };

  return (
    <Layout>
      <Content>
        <h1>AÑADIR PACIENTE</h1>
        
          <form class="wrapper">
            <div>
            <select
                  class="caja"
                  labelId="psicologo"
                  id="psicologo"
                  name="psicologo"
                  onChange={handlePsicologo}
                >
                  <option disabled selected>
                    Eligir psicologo
                  </option>
                    {psicologos.map((psicologo) => (
                  <option value={psicologo.idPsicolgo}>
                    {psicologo.nomPsicolgo} {psicologo.ap1Psicolgo} {psicologo.ap2Psicolgo}
                  </option>
                  ))}
                </select>
            </div>
            <div style={{ float: 'left', marginRight: '20px' }}>
              <label style={{ display: 'block' }} htmlFor="name">Paciente</label>
              <input type="text" name="nomPaciente" style={{ width: '250px' }} onChange={handlePaciente}/>&nbsp;
            </div>
            <div style={{ float: 'left', marginRight: '20px' }}>
              <label style={{ display: 'block' }} htmlFor="name">Apellido Paterno</label>
              <input type="text" name="nomPaciente" style={{ width: '250px' }} onChange={handleap1Paciente}/>&nbsp;
            </div>
            <div style={{ float: 'left', marginRight: '20px' }}>
              <label style={{ display: 'block' }} htmlFor="name">Apellido Materno</label>
              <input type="text" name="nomPaciente" style={{ width: '250px' }} onChange={handleap2Paciente}/>&nbsp;
            </div>
            <div style={{ float: 'left', marginRight: '20px' }}>
              <label style={{ display: 'block' }} htmlFor="name">Edad</label>
              <input type="text" name="nomPaciente" style={{ width: '250px' }} onChange={handleedadPaciente}/>&nbsp;
            </div>
            <div style={{ float: 'left', marginRight: '20px' }}>
              <label style={{ display: 'block' }} htmlFor="name">Sexo</label>
              <input type="text" name="nomPaciente" style={{ width: '250px' }} onChange={handlesexoPaciente}/>&nbsp;
            </div>
            <div >
              <p >
                <button class="redondeado" onClick={handleSubmit}>Guardar</button>&nbsp;
                <button class="redondeado" onClick={Cancelar}>Cancelar</button>&nbsp;
              </p>
            </div>
          </form>
      </Content>
    </Layout>
  );
};

export default PacientesAdd;
